package hackerrank;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;
import java.util.stream.Collectors;
import java.util.stream.LongStream;

public class WeightedUniformStrings {

    static String[] weightedUniformStrings(String s, int[] queries) {
        Map<Integer, Long> count = s.chars().map(c -> c - 96).boxed().sorted()
                .collect(Collectors.groupingBy(c -> c, Collectors.counting()));

        System.out.println(count);

        int val;
        Map<Integer, Integer> map =new HashMap<>();

        for(int i=0;i<s.length();i++){
            val=1;
            while (i<s.length()-1 && s.charAt(i)==s.charAt(i+1)){
                val++;
                i++;
            }
            int key=s.charAt(i)-96;
            if(map.getOrDefault(key,0)<val)
                map.put(key,val);
        }
        System.out.println(map);



        return Arrays.stream(queries).mapToObj(q->
                map.entrySet().stream()//.filter(c -> c.getValue()*c.getKey() >= q)
                        .filter(c->q%c.getKey()==0)
                        .anyMatch(c -> LongStream.rangeClosed(1, c.getValue())
                                .map(i -> i * c.getKey()).filter(i -> i == q).count() != 0) ?
                        "Yes":"No"
        ).toArray(String[]::new);

//        return Arrays.stream(queries).mapToObj(q->
//                count.containsKey(q)?"Yes":"No").toArray(String[]::new);

    }

    public static void main(String[] args) {
        System.out.println(Arrays.toString(weightedUniformStrings("",
                new int[]{
                        1536,//Yes
                        37736,//Yes
                        108256, //No
                        1919024,//Yes
                        38888,//Yes
                        108328,//No
                        1080173//No
        })));







    }



}
